package util

import "encoding/json"

func init() {
	info := make(map[string][]CountryCodeItem)
	if err := json.Unmarshal([]byte(__CountryCodeJsonStr), &info); err != nil {
		panic("初始化国家地区码资源信息json解析出现错误:" + err.Error())
	}
	for _, v := range info {
		for _, vv := range v {
			__CountryCode[vv.Code] = vv
			__CountryTel[vv.Tel] = vv
			__CountryNumber[vv.Number] = vv
		}
	}
}

type CountryCodeItem struct {
	English string `json:"english"`
	Chinese string `json:"chinese"`
	Pinyin  string `json:"pinyin"`
	Code    string `json:"code"`
	Zone    string `json:"zone"`
	Tel     string `json:"tel"`
	Number  string `json:"number"`
}

var __CountryCode = make(map[string]CountryCodeItem)

var __CountryTel = make(map[string]CountryCodeItem)

var __CountryNumber = make(map[string]CountryCodeItem)

// CN
func FetchCountryByCode(code string) *CountryCodeItem {
	if v, ok := __CountryCode[code]; ok {
		return &v
	}
	return nil
}

// 86
func FetchCountryByTel(tel string) *CountryCodeItem {
	if v, ok := __CountryTel[tel]; ok {
		return &v
	}
	return nil
}

// +86
func FetchCountryByNumber(number string) *CountryCodeItem {
	if v, ok := __CountryNumber[number]; ok {
		return &v
	}
	return nil
}

